import React, { Fragment } from "react";
import { Card, Icon, Avatar, Row, Col } from "antd";

const { Meta } = Card;

const ReservationList = ({ data, date }) => {
  return (
    <Fragment>
      <Row>
        {data.map(card => (
          <Col>
            <Card
              style={{ width: "300px" }}
              key={card.id}
              title={card.table_number}
            ></Card>
          </Col>
        ))}
      </Row>
    </Fragment>
  );
};

export default ReservationList;
